  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0143951 includes discrete
  sample and profile data collected from WECOMA and GYRE in the North Pacific Ocean
  and South Pacific Ocean from 1979-02-07 to 1980-06-14. These data include DELTA
  CARBON-14, DISSOLVED INORGANIC CARBON (DIC), DISSOLVED OXYGEN, HYDROSTATIC PRESSURE,
  NITRATE, NITRITE, OXYGEN - APPARENT UTILIZATION (AOU), Potential temperature (theta),
  SALINITY, SIGMA-T, TOTAL ALKALINITY (TA), WATER TEMPERATURE, phosphate and silicate.
  The instruments used to collect these data include CTD and bottle.nnThese data were
  collected by Taro Takahashi of Columbia University; Lamont-Doherty Earth Observatory
  as part of the FGGE_EQ_PAC_79-80 data set. CDIAC associated the following cruise
  ID(s) with this data set: FGGE_EQ_PAC_79-80\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
